import React, { forwardRef } from 'react';

const VideoPlayer = forwardRef((props, ref) => {
  return (
    <div>
      {/* Video element */}
      <video ref={ref} width="600" controls style={{ display: 'none' }}>
        <source src="full.mp4" type="video/mp4" />
      </video>
    </div>
  );
});

export default VideoPlayer;
